import React from 'react';
import s from './CheckList.module.css'
const CheckList = (props) => {
    return (
        <div className={s.wrapper}>
            {props.content} <br />
            <form action="POST" className={s.form}>
                <label className={s.tel__wrapper}>
                    Введите номер телефона <br />
                    <input type="tel" className={s.tel} placeholder='Телефон' required  minlength="8" maxlength="18" /> 
                </label>
                <label className={s.sum__wrapper}>
                    <br />Введите сумму (1-1000 руб)<br />
                    <input type="number" className={s.sum} placeholder='Сумма' required min="1" max="1000" />
                </label>
                <br />
                <button type='submit' className={s.btn}>Оплатить</button>   
            </form>       
        </div>
            );
        }
export default CheckList;
